INSERT INTO `message` VALUES (11,NULL,'Homepage','\r\n\r\n<!--  special school urgent notice -->\r\n\r\n<p>\r\n<!--  -->\r\n<div>\r\n<span style=\"align:center;color:red;\">\r\n<iframe src=\"https://calendar.google.com/calendar/embed?height=600&amp;wkst=1&amp;bgcolor=%23ffffff&amp;ctz=America%2FNew_York&amp;src=Y181Y2F2YTNscGo1MzlzY2k5MzNnNGs3amptc0Bncm91cC5jYWxlbmRhci5nb29nbGUuY29t&amp;src=ZW4udXNhI2hvbGlkYXlAZ3JvdXAudi5jYWxlbmRhci5nb29nbGUuY29t&amp;color=%23F6BF26&amp;color=%230B8043&amp;mode=AGENDA\" style=\"border:solid 1px #777\" width=\"800\" height=\"600\" frameborder=\"0\" scrolling=\"no\"></iframe>\r\n</span></div>\r\n<span style=\"align:center;color:red;\"><h2><a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\"></a></span>\r\n<span style=\"align:center;color:red;\"><h2><a href=\"http://hxcs.org/competition.aspx\" target=\"_blank\">(10122)(11122) (10222)(11222)(12222)(13222)(1)222) (15222)(103222020</a></h2></span>\r\n    <span style=\"align:center;color:red;\"><h2><a href=\"https://drive.google.com/file/d/1U7Z8wmpUj4SLhNh71jsr3evugllJmtOf/view?usp=sharing\" target=\"_blank\">Kai Yang, Michael Tan, Elias Chang, Albert ChenTeenTeachKids Hackathon 2020 !</a></h2></span>\r\n<span style=\"align:center;color:red;\"><h2><a href=\"http://www.huaxiabh.org/Home/ViewMessage/30\" target=\"_blank\">Call for high school volunteers for 2020-2021!</a></h2></span>\r\n\r\n<span style=\"align:center;color:red;\"><h2><a href=\"https://drive.google.com/file/d/1cIuHC10SZGS-HuRMwI8CqRAJTPTUQpp1/view?usp=sharing\" target=\"_blank\">Request refund check for cancelled Spring 2020 classes due to COVID-19</a></h2></span>\r\n\r\n<span style=\"align:center\"><h2><a href=\"https://drive.google.com/file/d/1mx6kvcXO0NZ20Ewst7r42YEp81LykPpR/view?usp=sharing\" target=\"_blank\">2020-2021 School Calendar 2020-2021</a></h2></span>\r\n\r\n<span style=\"align:center\"><h2><a href=\"https://docs.google.com/document/d/1afe0B0LxjVHxGqDuF_8za5KZQw85yBh0fmliXxbpDfA/edit?usp=sharing\" target=\"_blank\">2020-2021 Course Schedule</a></h2></span>\r\n\r\n<span style=\"align:center;color:red;\"><h2><a href=\"http://www.huaxiabh.org/Home/ViewMessage/44\" target=\"_blank\">Donate to our school ?</a></h2></span>\r\n\r\n<!--  -->\r\n<span style=\"align:center\"><h2><a href=\"/Home/ViewMessage/53\" target=\"_blank\">2020-2021 School Year Registration</a></h2></span>\r\n<p>\r\nBerkeley Heights Huaxia Chinese School (BHHXCS) is located at Berkeley Heights, opens to all residents in the neighborhood. BHHXCS is a <strong>501(c)(3) nonprofit organization</strong>, a community oriented, cultural educational institute. Early Bird Registration for the 2020-2021 school year extended to Friday, 7/31 </p>\r\n\r\n<div style=\"font-weight:bold; color:red;padding-left:5px;\">\r\n<p>* To help parents deal with the uncertainty and ease the concerns might be caused by COVID-19 possibly into new school year, our school will stay online during the Fall semester while school closely monitor the situation for the next Spring, any Cultural/Enrichment classes that can\'t be offered online are eligible for prorated refund/credit.\r\n</p>\r\n</div>\r\n\r\n<p>\r\nIMPORTANT: Please refer to <br> \r\n<ul>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1YZZnxl9jNEzqq1f6tCCoFeKuOD1U6QKYtRpWBb0KebU/edit?usp=sharing\" target=\"_blank\"></a></span> || <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1yNgmr_pxLtE6qbErxrYLxXxqLL02jkMqU5TE_o2oNb8/edit?usp=sharing\" target=\"_blank\">Registration Guidelines</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/spreadsheets/d/1eFtg3fIrGAI5hoHOgV10N1xF9Q_X4nh6E2n4PPXEpRc/edit?usp=sharing\" target=\"_blank\">Course Catalog ()</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">Course Descriptions for Chinese Classes ()</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1afe0B0LxjVHxGqDuF_8za5KZQw85yBh0fmliXxbpDfA/edit?usp=sharing\" target=\"_blank\">Course Schedule</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1j8ZG4eSN0YMgCaS6So6sJvYirddxsiwi/view?usp=sharing\" target=\"_blank\">Change Registration Form (for Change/Cancel registration email to accounting@huaxiabh.org)</a></span>\r\n</li>\r\n</p>\r\n\r\n<p>\r\n 1. One account per family <span style=\"font-weight:bold; color:red;\"><del>Early Bird saving of $50 Registration Fee by July 6</del> $50 discount honored for all families, no expiration date for peace of mind!</span>\r\n</p>\r\n\r\n<p>\r\nTo honor your registration, Do make sure you exactly follow the above-mentioned <a href=\"https://docs.google.com/document/d/1yNgmr_pxLtE6qbErxrYLxXxqLL02jkMqU5TE_o2oNb8/edit?usp=sharing\" target=\"_blank\">Registration Guidelines</a>, pay tuition balance by \r\n<ul>\r\n    <li>Zelle Pay (Chase Quickpay etc) is highly recommended, sending payment to accounting@huaxiabh.org, adding memoDo put your registered school account username (email) and name, Students name, as completed as possible if text field allowed by your online banking\r\n    </li>\r\n    <li>PayPal to accounting@huaxiabh.org, use fee-free option(otherwise your payment will be returned, refer to Registration Guidelines for detailed instruction!) \r\n    </li>\r\n    <li>or include signed copy of Registration Summary and a check payable to <strong>BH Huaxia</strong> mailing to  364 Springfield Ave #539, Berkeley Heights, NJ 07922, <span style=\"font-weight:bold; color:red;\">failure to do in 7 days so will void your registration</span>.\r\n   </li>\r\n</ul>\r\n</p>\r\n\r\n<p>\r\n2. <a href=\"https://drive.google.com/open?id=0B8E9IyDma37Ob3NqNzZWS2JfWTQ\" target=\"_blank\"><font color=\"blue\"></font></a>, <a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\" target=\"_blank\"><font color=\"blue\">Download Textbook</font></a> \r\n\r\n\r\n<li><a href=\"https://drive.google.com/file/d/1zyAaZ9pKv9hKjj-wCQXaEjSzbugvmQvN/view?usp=sharing\" target=\"_blank\"> Preschool</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1b7uBN1lpxKVuhZYJk93XvjviJoCvxD-z/view?usp=sharing\" target=\"_blank\"> Kindergarten</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\"> 1st to 9th Grade</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1AosxHJYHAtF6kKjaxSPAkIg1mZUh9JGD\" target=\"_blank\"> CSL (Chinese as Second Language)</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1S8RRDi1UjijlMQJ2g0IYzDqPFrC0N3az\" target=\"_blank\">() Junior Mandarin</a></li>\r\n<li>AP Chinese (10th Grade and higher, passed HSK4)</li> \r\n</p>\r\n<p>\r\n3. <span style=\"font-weight:bold; color:blue;\">All popular Cultural classes to be offered (<span style=\"font-weight:bold; color:red;padding-left:5px;\">, ! Small class size, 4-6 kids only!<span>):</span>\r\n<ul>\r\n<span style=\"font-weight:bold; color:blue;\">STEM/Enrichment classes:</span>\r\n\r\n<li> English Reading&Writing offered by KEC (<a href=\"https://drive.google.com/file/d/1uW3JBY-TTA2BTtKnlSmG-x7g63L56Pcy/view?usp=sharing\" target=\"_blank\">3 classes for 3rd-4th, 5th-6th and 7th-9th grades</a>)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1lSmDWo5V49MLbWnx2NmMeeNhzo0V0fZs/view?usp=sharing\" target=\"_blank\"> (Kids Python, recommend 5th Grade+)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">space limited, register asap before full<span></li> \r\n\r\n<li>\r\n    <ul><a href=\"https://drive.google.com/file/d/1mNxzsi-ICKVLQebc5TOIbr0x43PsNYz_/view?usp=sharing\" target=\"_blank\">BHHXCS-ThinkAI(AI001, AI002) </a>\r\n         <li><a href=\"https://drive.google.com/file/d/1SVw0CYAWDCsjE7gbEWhcKhzPSCsEGpFv/view?usp=sharing\" target=\"_blank\">AI001 Scratch (recommend 8yr+)</a></li>\r\n         <li><a href=\"https://drive.google.com/file/d/1O1gIxtLMQoNMNJcBz9aGeY1l7MqCl7wI/view?usp=sharing\" target=\"_blank\">AI002 Scratch+AI (10yr+)</a> <span style=\"font-weight:bold; color:red;padding-left:5px;\">New class, Hot! filled very soon!<span></li>\r\n    </ul>\r\n</li>\r\n<li><a href=\"https://drive.google.com/open?id=1Rf7OcLxXT-JXWjrUqmuQjHbLRhqRMil7\" target=\"_blank\">3D 3D Printing & Science Class)</a></li> \r\n\r\n<li><a href=\"https://drive.google.com/file/d/1CXC7lfJ8I4PUE4cM_CiqSKW9lA-zhTBG/view?usp=sharing\" target=\"_blank\"> Geometry </a>(for rising 7-8th Grade) <span style=\"font-weight:bold; color:red;padding-left:5px;\">New class!<span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1CXC7lfJ8I4PUE4cM_CiqSKW9lA-zhTBG/view?usp=sharing\" target=\"_blank\"> Algebra I&II </a>(for rising 7-8th Grade) <span style=\"font-weight:bold; color:red;padding-left:5px;\">New class!</li>\r\n<li><a href=\"https://drive.google.com/file/d/15S-2Ri5eeIT_3evI1S064LjsYfYo91Q7/view?usp=sharing\" target=\"_blank\"> AMC8 (for rising 6/7/8 grade)</a>, <a href=\"https://drive.google.com/file/d/1UqJ0dGrwcU52IjZSJ3u4JzorY3RevrRn/view?usp=sharing\" target=\"_blank\">AMC10 (for rising 9/10 grade)</a>, <a href=\"https://drive.google.com/file/d/1UqJ0dGrwcU52IjZSJ3u4JzorY3RevrRn/view?usp=sharing\" target=\"_blank\">AMC12 (for rising 10th grade)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">New class, filled very soon!<span></li>\r\n\r\n<li><a href=\"https://drive.google.com/open?id=1Lm80ioWLPpyQslmlzQAO45RKkAQ97enU\" target=\"_blank\">SAT SAT Reading & Writing</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1o4FaWnPZV0udUPrlsyOfMmmvfloO5Ltd/view?usp=sharing\" target=\"_blank\"> Math Enrichment</a> 1st/2nd Grade, 3rd/4th Grade, 5th/6th Grade textbook Singapore Math<span style=\"font-weight:bold; color:red;padding-left:5px;\">For Grade 7&8 concentrate on AMC8-American Mathematics Contest 8, register asap before full<span></li>\r\n\r\n\r\n<span style=\"font-weight:bold; color:blue; padding-top: 20px;\">Other Enrichment/Cultural classes:</span>\r\n\r\n<li><a href=\"https://drive.google.com/open?id=11Bc4V5PC8FTroBdITB4cBePA25Lh9TCN\" target=\"_blank\"> Chess</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1dzEkQoQ58iAn48Xtx7c9asnjz9YZSHuX/view?usp=sharing\" target=\"_blank\">() Go (WeiQi)</a></li>\r\n\r\n<li><a href=\"https://drive.google.com/file/d/1nOu-RKAgxM6zBW1JzrgQTREln-E7OLw5/view?usp=sharing\" target=\"_blank\"> Kids Ballet</a>(6-10 years old)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1ZuPcoU5Gp8M2QlUOy6Rv00xj9Qq8E9js/view?usp=sharing\" target=\"_blank\">+ Chinese Calligraphy&Painting</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1xG_1OJ6s4BftmQq8ElPdIUdO_we-xJJX/view?usp=sharing\" target=\"_blank\"> Kids Singing& Dancing</a>(3-6)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1HJ1hSzRVEk0i01qCMBzul5PaF-gsgGfy/view?usp=sharing\" target=\"_blank\">Art & Craft</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1-RitNgShTqwO-KygNKM0yFefFzzD5q9V\" target=\"_blank\"> Sewing and Tailoring Technique</a> ( opens all age groups)</li>\r\n\r\n<li><a href=\"https://drive.google.com/file/d/1Ld9XrDq6ELvkKCHnY-Bs_3Z6lWIxnfiD/view?usp=sharing\" target=\"_blank\"> Drawing Art </a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Q8obUc60WPJX0x5Tm6meozycWcubOQ_e/view?usp=sharing\" target=\"_blank\">ESL</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Free to local residents <span></li>\r\n</ul>\r\nThe Course Schedule will be finalized in late August according to the the enrollment of the classes.\r\n</p>\r\n<p>\r\n4. School opens ONLINE on Saturdays (1:30pm - 5pm) during school year of BH Public Schools.\r\n\r\n\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n  <a href=\"https://www.tapinto.net/towns/berkeley-heights/sections/giving-back/articles/local-chinese-community-donates-personal-protection-equipment-to-frontline-and-healthcare-workers\" target=\"_blank\"><img src=\"https://drive.google.com/uc?export=view&id=1FM2DKP5LuQWYngH098Qp8eWJLvk3mLaf\" style=\"height: 80%; width: 80%;margin-left: auto;margin-right: auto;\"><a/>\r\n<p style=\"font-size: 1.2em; font-weight: bold;\">\r\n      <a href=\"https://www.tapinto.net/towns/berkeley-heights/sections/giving-back/articles/local-chinese-community-donates-personal-protection-equipment-to-frontline-and-healthcare-workers\" target=\"_blank\">\"Local Chinese Community Donates Personal Protection Equipment to Frontline and Healthcare Workers\", reported by TAPinto, 4/15, 2020</a>\r\n      </p>\r\n</div>\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n  <img src=\"https://drive.google.com/uc?export=view&id=1qQv-DTPP9lQbVTK_NtfzqJboN5ptgBMB\" style=\"height: 80%; width: 80%;margin-left: auto;margin-right: auto;\">\r\n</div>\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"https://smile.amazon.com/ch/81-1283070\" target=\"_blank\"><img src=\"http://www.huaxiabh.org/Content/img/amazonsmile.png\" style=\"height: 50%; width: 50%;\"></a>\r\n      <p style=\"font-size: 1.2em; font-weight: bold;\">\r\n      Simply click on the logo above to enter Amazon.com and a percentage of any resulting purchases will be returned to the Berkeley Heights Huaxia Chinese School.  What a better way to support our school while shopping for your everyday purchases without spending any extra money!\r\n      </p>\r\n</div>\r\n\r\n\r\n\r\n\r\n<div id=\"homepage-sticky-notice\" class=\"row\" style=\"padding-top: 20px;\">\r\n\r\n<p>\r\n<font color=\"red\">For People Who Don\'t Understand Chinese! </font>\r\n <a href=\"http://www.huaxiabh.org/Home/ViewMessage/28\"> Please Click Here For School Class Information and Registration Process</a>\r\n</p>\r\n\r\n</div>','notification','2016-02-29 00:18:48',NULL),(12,NULL,'','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\"></a>\r\n</p>\r\n\r\n<h2> </h2>\r\n<p>\r\n<p>\r\n<p> \r\n </p>\r\n<p>\r\n, \r\n</p>\r\n<p>\r\n<br/>\r\n1); ; <br/>\r\n2<br/>\r\n3\r\n</p>\r\n<p>\r\n,  Columbia Middle School,  78  41 info@huaxiabh.org. , waiting-list, \r\n\r\n\r\n</p>\r\n<p>\r\n<a href=\"https://drive.google.com/file/d/0B8E9IyDma37OWGxxZHpLSDlCT1E/view?usp=sharing\">Please Click this Link to Get Application Form</a>\r\n</p>\r\nThank you\r\n</p>\r\n<p>\r\n<font color=\"red\">,! </font>\r\n','notification','2016-03-03 19:43:21',NULL),(13,NULL,'(Student Rules)','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\"></a>\r\n</p>\r\n<h2></h2>\r\n<p>\r\n1. \r\n</p>\r\n<p>\r\n2.  \r\n</p>\r\n<p>\r\n3. \r\n</p>\r\n<p>\r\n4. \r\n</p>\r\n<p>\r\n5. \r\n</p>\r\n<p>\r\n6. ,\r\n</P>\r\n<p>\r\n7. \r\n</p>\r\n<p>\r\n8.  \r\n</p>\r\n\r\n','policy','2016-03-03 19:46:20',NULL),(17,NULL,'','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\"></a>\r\n</p>\r\n<h2></h2>\r\n<p>2013CNN50CSL ; \r\n </p>\r\n<p>\r\nBerkeley Heights Huaxia Chinese School (BHHXCS) is located in Berkeley Heights, NJ (ranked #6 by CNN/Money in the \"Best Places to Live-America\'s Top 50 Small Towns\"). Many Chinese families are attracted to this town for the friendly neighborhoods, easy commute to New York City and excellent public school system. BHHXCS is a community oriented, non-religious, non-political cultural educational institute. BHHXCS is a totally independent organization and isn\'t affiliated to any other institution. BHHXCS offers weekend Chinese Language Curriculum Class and Chinese Language as a Second Language (CSL) Class.  BHHXCS provides classroom instruction on Chinese language and culture, and also provides a common space for interactions within the Chinese community. BHHXCS strives to succeed in teaching Chinese and  promoting Chinese culture by engaging every student\'s curiosity with its unique educational style. \r\n</p>\r\n\r\n\r\n<p>\r\ninfo@huaxiabh.org</p>\r\n</p>\r\n','notification','2016-03-20 23:00:07',NULL),(18,NULL,'','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\"></a>\r\n</p>\r\n<h2></h2>\r\n<p>\r\n201621\r\n</p>\r\n<p>\r\nBerkeley Heights BOEColumbia Middle School\r\n</p>\r\n<p>\r\n201691:30 5:00\r\n</p>\r\n<p>\r\nEINNJ\r\n</p>\r\n<p>\r\n\r\n</p>\r\n<p>\r\n\r\n</p>\r\n<p>\r\n\r\n</p>\r\n\r\n<p>\r\n\r\n</p>\r\n','notification','2016-03-28 01:07:38',NULL),(19,'introduction','Introduction','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\"></a>\r\n</p>\r\n\r\n<h2>Introduction</h2>\r\n\r\n<p>\r\nBerkeley Heights Huaxia Chinese School (BHHXCS) is located in Berkeley Heights, NJ (ranked #6 by CNN/Money in the \"Best Places to Live-America\'s Top 50 Small Towns\"). Many Chinese families are attracted to this town for the friendly neighborhoods, easy commute to New York City and excellent public school system. BHHXCS is a community oriented, non-religious, non-political cultural educational institute. BHHXCS is a totally independent organization and isn\'t affiliated to any other institution. BHHXCS offers weekend Chinese Language Curriculum Class and Chinese Language as a Second Language (CSL) Class.  BHHXCS provides classroom instruction on Chinese language and culture, and also provides a common space for interactions within the Chinese community. BHHXCS strives to succeed in teaching Chinese and  promoting Chinese culture by engaging every student\'s curiosity with its unique educational style. \r\n</p>\r\n<p>\r\n2013CNN50CSL ; \r\n</p>\r\n\r\n\r\n<p>\r\nEmailinfo@huaxiabh.org</p>\r\n','notification','2016-04-02 12:59:16',NULL),(20,'board','School Board of Directors','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\"></a>\r\n</p>\r\n\r\n<h2>Board of Directors