d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">Chinese Language classes: Preschool, Kindergarten, 1st to 9th Grade,  CSL (Chinese as Second Language) and Junior Mandarin</a>. <br />\r\n \r\n</p>\r\n<p>\r\n3. <span style=\"font-weight:bold; color:blue;\">All popular Cultural classes to be offered:</span>\r\n<ul>\r\n<li><a href=\"https://drive.google.com/open?id=1AosxHJYHAtF6kKjaxSPAkIg1mZUh9JGD\" target=\"_blank\"> CSL (Chinese as Second Language)</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1S8RRDi1UjijlMQJ2g0IYzDqPFrC0N3az\" target=\"_blank\">() Junior Mandarin</a></li>\r\n<li>AP Chinese (10th Grade and higher, passed HSK4)</li>\r\n<li> English Reading&Writing (<a href=\"https://drive.google.com/open?id=14rOgH8lPzWfDbY2TKAo75NkTMzxhkUUL\" target=\"_blank\">for 3rd-4th and 5th-6th grades</a>, <a href=\"https://drive.google.com/file/d/17sKobRAnksKlb_aTQLCQzd8jjdoVJqk2/view?usp=sharing\" target=\"_blank\">for 7th-9th Grade</a>)</li>\r\n<li><a href=\"https://drive.google.com/open?id=1jg8eLyr3yEmqx2nJRWhm0kpTMz5FwMhR\" target=\"_blank\"> (Kids Python, recommend 5th Grade+)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">space limited, register asap before full<span></li> \r\n<li><a href=\"https://drive.google.com/open?id=1Lm80ioWLPpyQslmlzQAO45RKkAQ97enU\" target=\"_blank\">SAT SAT Reading & Writing</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1Z33cLQSKc2yKJDtBR0NGPho2biA_Aemh\" target=\"_blank\"> Math Enrichment</a>4 Levels for 1st to 8th Grade <span style=\"font-weight:bold; color:red;padding-left:5px;\">For Grade 7&8 concentrate on AMC8-American Mathematics Contest 8, register asap before full<span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1ZuPcoU5Gp8M2QlUOy6Rv00xj9Qq8E9js/view?usp=sharing\" target=\"_blank\">+ Chinese Calligraphy&Painting</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1xG_1OJ6s4BftmQq8ElPdIUdO_we-xJJX/view?usp=sharing\" target=\"_blank\"> Kids Singing& Dancing</a>(3-6)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1HJ1hSzRVEk0i01qCMBzul5PaF-gsgGfy/view?usp=sharing\" target=\"_blank\">Art & Craft</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1-RitNgShTqwO-KygNKM0yFefFzzD5q9V\" target=\"_blank\"> Sewing and Tailoring Technique</a> ( opens all age groups)</li>\r\n<li><a href=\"https://drive.google.com/open?id=11Bc4V5PC8FTroBdITB4cBePA25Lh9TCN\" target=\"_blank\"> Chess</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1Rf7OcLxXT-JXWjrUqmuQjHbLRhqRMil7\" target=\"_blank\">3D 3D Printing & Science Class)</a></li> \r\n<li><a href=\"https://drive.google.com/file/d/1BLdgLeBFeX2vEPOR8qdSYur3EtQrvqTN/view?usp=sharing\" target=\"_blank\"> Drawing Art </a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Q8obUc60WPJX0x5Tm6meozycWcubOQ_e/view?usp=sharing\" target=\"_blank\">ESL</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Free to local residents <span></li>\r\n</ul>\r\nThe Course Schedule will be finalized in late August according to the the enrollment of the classes.\r\n</p>\r\n<p>\r\n4. We are located at Columbia Middle School, school opens on Saturdays (1:30pm - 5pm) during school year of BH Public Schools.\r\n<div style=\"font-weight:bold; color:red;padding-left:5px;\">\r\n<p>* To help parents deal with the uncertainty and ease the concerns might be caused by COVID-19 possibly into new school year, our school may stays online for a period of time while evaluating the developing situation by then, any Cultural/Enrichment classes that can\'t be offered online are eligible for prorated refund/credit.\r\n</p>\r\n</div>\r\n\r\n\r\n<p>\r\n\r\n</p>\r\n\r\n</p>\r\n\r\n','notification','2019-08-16 13:18:05',NULL),(54,NULL,'BH20182019','<div class=\"row\" style=\"padding-top: 10px;\">\r\n     <a href=\"https://www.tapinto.net/towns/berkeley-heights/articles/berkeley-heights-chinese-community-hosted-chinese-new-year-culture-fair-and-spectacular-show\" target=\"_blank\"><img src=\"h